(2810, 1, 1563, 33, '60.0', 0, '02/01/2012(01/12)-CITRIX\r\n\r\ncontrol buen funcionamiento internet y acceso a citrix desde máquinas de SESE. \r\n\r\nCitrix no funciona (empty). \r\n\r\nse instala nuevamente ordenador \"maquetado de seat\" para que puedan trabajar.\r\n\r\nTotal: 3 horas.\r\n\r\n\r\n\r\n03/01/2012(01/12)-CITRIX	180	180	\r\n\r\ncontrol buen funcionamiento internet y acceso a citrix desde máquinas de SESE. \r\n\r\nCitrix funciona, pero se decide seguir con maquetado SEAT por compatibilidad \r\n\r\ncon etiquetas. se instala nuevamente ordenador \"maquetado de seat\".\r\n\r\nTotal: 3 horas.\r\n\r\n\r\n\r\n10/01/2012(01/12)-IMPRESORAS	\r\n\r\nconfiguraciones varias comprobaciones impresoras ricoh mal funcionamiento \r\n\r\ncon citrix y con SAP. ciertos formularios no los imprimen bien, etc.\r\n\r\nTotal: 12 horas. se contabilizan 8 horas\r\n\r\n\r\n\r\n10/01/2012(01/12)-SIGLA_GEARBOX\r\n\r\nConfiguraciones varias en ordenador sigla de gearbox\r\n\r\nTotal: 2 horas\r\n\r\n\r\n\r\n11/01/2012(01/12)	IMPRESORAS	\r\n\r\ncomprobación impresoras imprimen bien en ARE1, ARE2. \r\n\r\nproblemas varios con impresión desde Citrix y desde SAP\r\n\r\nTotal: 3 horas, se contabilizan 2 horas.\r\n\r\n\r\n\r\n12/01/2012(01/12)	IMPRESORAS\r\n\r\nconfiguración impresora HP Color LaserJet 3600n para hacer pruebas varias \r\n\r\ncon acceso a SAP mediante Citrix reunión con Gerard (de SEAT) para tratar \r\n\r\nproblemas de impresión desde SAP - Citrix\r\n\r\nTotal: 8 horas (dos empleados). se contabilizan 4 horas.\r\n\r\n\r\n\r\n13/01/2012(01/12)	Laserjet	120	0	\r\n\r\nInstalacion impresora HP laserjet en ARE1\r\n\r\nTotal 2 horas, se contabilizan 0 horas.\r\n\r\n\r\n\r\n16/01/2012(01/12)-GEARBOX-IMPRESORAS\r\n\r\nconfiguraciones con GEARBOX, comprobar impresora, problemas varios con impresión. \r\n\r\nInstalación CITRIX en ordenador que envían desde ZGZ problema con maquetado CISCO VPN\r\n\r\nTotal 5 horas. se contabilizan 3 horas.\r\n\r\n\r\n\r\n\r\n\r\n23/01/2012(01/12)-Impresora\r\n\r\nIntento configuración impresora traída desde Zaragoza (la que la sustituye) \r\n\r\nActualmente la impresora mp161 esta en ARE3\r\n\r\nTotal: 3 horas. se contabiliza 1 hora.\r\n\r\n\r\n\r\n24/01/2012(01/12)-Impresoras\r\n\r\nConfiguración y comprobación con it solución center impresora conectada en ARE2, \r\n\r\nal ordenador citrix. Se trata de la nueva impresora que se ha sustituido \r\n\r\npor la ricoh mp161 enviada desde Zaragoza\r\n\r\nTotal 2,5 horas. se contabilizan 2 horas.\r\n\r\n\r\n\r\n31/01/2012(01/12)-Impresoras ARE3\r\n\r\nInstalación ordenador con citrix en ARE3 y configuración impresora MP161 \r\n\r\nde ricoh problemas varios en ARE2 y en ARE1 con las impresoras \r\n\r\ny su configuración\r\n\r\nTotal 4 horas. Se contabilizan 3 horas.\r\n\r\n\r\n\r\n31/01/2012(01/12)-Impresoras ARE1, ARE2\r\n\r\nproblemas con impresoras y su configuración en ARE1, ARE2. \r\n\r\nVisita de 20 a 23 horas\r\n\r\nTotal 2 horas.', 1),
