(2823, 243, 1572, 0, '0.0', 0, 'Se diagnostica ordenador HP Pavilion PCM8000 con número serie CZX733XS4P.\r\n\r\nOrdenador no arranca, se comprueba:\r\n\r\nSe observa un chispazo en la placa base, provocando que se queme Placa, Procesador, RAM, Fuente de alimentación, Tarjeta capturadora.\r\n\r\nDicho chispazo ha sido provocado por una subida repentina de tensión pico eléctrico.\r\n\r\nSe descarta rayo atmosférico.\r\n\r\nSe observan las siguientes anomalías:\r\n\r\nNo funciona Placa para procesador AMD DUAL CORE\r\n\r\nNo funciona Procesador. AMD ATHLON 64X2 DUAL CORE. 2.6GHz.\r\n\r\nNo funciona Memoria RAM. 2 GB. DDR2-SDRAM 240-PIN\r\n\r\nNo funciona Fuente de Alimentación\r\n\r\nNo funciona tarjeta capturadora', 1),
