(6615, 195, 4319, 1, '13673.53', 9244.88, 'Pedido Compra PC17-01721\r\n\r\n\r\n\r\nAPARTADO 1\r\n\r\n\r\n\r\nSuministro y colocación de 3 columnas (mástil) de 6 mts. De altura en asfalto existente.\r\n\r\nIncluye la obra civil de sujetar en pavimento y/o asfalto existente, collar el kit de pletina de instalación de cada báculo y dejar colocado la farola.\r\n\r\n\r\n\r\nAPARTADO 2\r\n\r\n\r\n\r\nSuministro y colocación de tubo corrugado de D63 (marcado en amarillo en el plano); introducir los 3 cables de fibra ópitca por este corrugado. Un cable de FO se qeuda en la farola número 1.\r\n\r\n\r\n\r\nAPARTADO 3\r\n\r\n\r\n\r\nDotar de conexión eléctrica a los báculos (3 en total). Manguera de 5x2,5mm. Incluye dejar el cable eléctrico y caja de conexionado en cada uno de los 3 mástiles.\r\n\r\n\r\n\r\nProtección térmica y diferencial en el cuadro que exista en dicha caseta del Punto B.\r\n\r\n\r\n\r\nAPARTADO 4\r\n\r\n\r\n\r\nPasar 2 cables de FO para cada una de los báculos restantes por tuberías de pre-instalación ya existentes (del Punto A al B. Incluye proteger los cables de FO con un tubo independiente corrugado de D16. Cada cable por 1 tubo corrugado. 2 en total. Según indicaciones de Ingeniería técnica (Néstor)\r\n\r\n\r\n\r\nConversor de FO 1000 Mbps multimodo de LC a RJ45 a 550m. 3 unidades. 1 para cada mástil.\r\n\r\n\r\n\r\nAPARTADO 5\r\n\r\n\r\n\r\nConfección mecánica tipo tejadillo metálico para proteger de la lluvia y las inclemencias del tiempo los puestos WIFI de cada uno de los mástiles. Se hará tipo cubo al revés para proteger elementos.\r\n\r\n\r\n\r\nAPARTADO 6\r\n\r\n\r\n\r\nPasar cable FO desde CPD a arqueta registro exterior en la nave industrial. Y luego hasta oficina en zona SKD siguiendo recorrido del cable de FO actual. Se estiman unos 900 metros de FO (valor aproximado).', 1),
