(3749, 252, 2132, 1, '11498.0', 8190.16, 'Rack sobre puerta producción (Unifica Laboratorio y Enfermeria)\r\n\r\nSwitch y material para conexionado con RED de Industrialesud\r\n\r\n\r\n\r\nTotal            1.750\r\n\r\nDescuento         -400\r\n\r\n                ------\r\n\r\nTotal            1.350\r\n\r\n\r\n\r\nControl Accesos\r\n\r\n===============\r\n\r\n\r\n\r\nControladoras (Torno1, Torno2, Pta. Metal, Vestuario y Producción, Produccion y Cristal)\r\n\r\n\r\n\r\nLectores Proximidad. (2x Torno1, 2x Torno2, 1x Pta. Metal, 1x Vestuario, 1x Producción, \r\n\r\n                      1x Producción, 1x Cristal)\r\n\r\n\r\n\r\nSoftware Control de Accesos NTACCESS.\r\n\r\nConfiguración módulo accesos y/o visitas\r\n\r\ninstalacion y puesta en marcha hardware\r\n\r\n\r\n\r\n\r\n\r\nTotal            8.525\r\n\r\nDescuento (20%) -1.705\r\n\r\n                ------\r\n\r\nTotal            6.820\r\n\r\n\r\n\r\nControl Horario\r\n\r\n===============\r\n\r\n\r\n\r\nunidad Terminal control horario\r\n\r\nSoftware control Horario NETTIME. Para 250 alta.\r\n\r\nMódulo visitas.\r\n\r\nInstalacion y pueta en marcha\r\n\r\n\r\n\r\nTotal            4.160\r\n\r\nDescuento (20%)   -832\r\n\r\n                ------\r\n\r\nTotal            3.328', 1),
(3751, 195, 2133, 1, '1125.0', 210, 'Trasladar centralita telefónica, junto con enlaces móviles desde despacho Diagonal \r\n\r\na despacho Consell de Cent\r\n\r\n\r\n\r\nConexión centralita en despacho consell de cent usando los hilos de telefónica sitos en Despacho Alejandro Ylla. \r\n\r\n\r\n\r\nTrasladar rack con switch, modem Movistar desde despacho Diagonal a Consell de Cent. \r\n\r\n\r\n\r\nConexión en despacho nuevo en ala derecha de la mesa de Alejandro, bajo el ala y junto a la cajonera.\r\n\r\n\r\n\r\nParcheado de conexiones de red y centralita según ramal de cables que sale de pared bajo ventana en despacho A. Ylla.\r\n\r\n\r\n\r\nPoner roseta en puntos de red situados por despachos es decir, despacho AYlla, despacho\r\n\r\ncomunitario y despacho Isla. Poner punto en zona entrada mano derecha.\r\n\r\n\r\n\r\n\r\n\r\nMontar regleta en despacho isla para pasar cable eléctrico (regleta) y cable de RED.\r\n\r\nPoner pequeño router entre las 4 mesas\r\n\r\nPoner regleta\r\n\r\n\r\n\r\nsuministro y montaje regletas RJ45 en puntos de RED.\r\n\r\n\r\n\r\nMontaje canaleta en puesto de entrada \r\n\r\nswitch en despacho de entrada.', 1),
