(3795, 1, 2162, 1, '2475.0', 947, 'Pasar cable de RED RJ45 desde punto actual \r\n\r\n(entre planta 0 y planta 1  zona de oficinas) \r\n\r\npor ascensor manual (para mercancías) y hacerlo llegar \r\n\r\nal hueco del ascensor.\r\n\r\n\r\n\r\nDesde hueco de ascensor se hace llegar hasta \r\n\r\nprimera planta  pasada sala de TV, donde llegan todos \r\n\r\nlos accesos de Telefónica/Movistar.\r\n\r\n\r\n\r\nAhí se pone un switch de 16 bocas, para poder tirar cable \r\n\r\nhasta despachos pasillo que da a Sala TV y enfermería; \r\n\r\nsita. Entre planta 1 y 0 (mismo nivel que zona Oficinas) \r\n\r\nal otro lado del hueco del ascensor.\r\n\r\n\r\n\r\nDesde donde está el Swtich, se pasa cable para poner \r\n\r\ndos puntos de red (acceso a Internet) en biblioteca y \r\n\r\nzona final de biblioteca.\r\n\r\n\r\n\r\nMaterial\r\n\r\nRosetas para 8 puestos de red\r\n\r\nTubo corrugado\r\n\r\nCable RED, 1 bobina de 300 metros, 1 bobina de 100 metros\r\n\r\nConectores, regleta, etc.\r\n\r\nVarios (tornillería, etc.)\r\n\r\n\r\n\r\nMano de obra.', 1),
